}}
maxSpeed=16
t=0
position={
	x=96,
	y=24
}
speed=0
count=0
function button(id,dimension)
	local sign=id%2
	if sign == 0 then sign=-1 end
	if btn(id) then 
		speed=(1+speed)
		sum=(speed*sign)/count
		position[dimension]=position[dimension]+sum
		return id
	end
	return 'none'
end
room={x=0,y=0}
resolution={
	x=240,y=136
}
tilePixels=8
subpixelsPerPixel=16
function input()
	cls(13)
	map(room.x*resolution.x/tilePixels,
		room.y*resolution.y/tilePixels)
	for i=0,3 do
		if btn(i) then  
			count=count+1
		end
	end
	button(0,'y')
	button(1,'y')
	button(2,'x')
	button(3,'x')
	
	if count==0 then	
		speed=0
	end
--	if count==2 then 
		--speed=(speed/math.sqrt(2))*(speed*2) 
--	end
	pixel={
		x=position.x/subpixelsPerPixel,
		y=position.y/subpixelsPerPixel
	}
	maxSpeed=32
	if speed>maxSpeed then 
		speed=maxSpeed 
	end
	if pixel.x>240 then 
		position.x=0 
		room.x=room.x+1
	end
	if pixel.x<0 then 
		room.x=room.x-1
		position.x=240*16 
	end
	if pixel.y<0 then 
		position.y=136*16 
		room.y=room.y-1
	end
	if pixel.y>136 then 
		position.y=0 
		room.y=room.y+1
	end
	if room.x<0 then room.x=7 end
	if room.y<0 then room.y=7 end
	
	if room.x>7 then room.x=0 end
	
	if room.y>7 then room.y=0 end
	rectb(0,0,resolution.x,resolution.y,5)
	spr(math.random(0,subpixelsPerPixel-1)*subpixelsPerPixel,
	pixel.x,pixel.y,-1,1,0,0,1,1)
	t=t+1
	count=0
end
function TIC()
	input()
	matrix()
end
function horizontal(x,y,c1,v1,c2)
	syllable(x,y,c1,v1,nil,nil,c2,8)
end
function matrix()
	w=14
	h=20
	tiles={x=17,y=6}
	syllables={
		{1,'j_','eo'},{2,'n_','eu','n_'},{1--,'z','z'
		},
		{1,'g_','a_'},
		{2,'b_','eu'},
		{1,'r_','i_'},{1,'ng','e_','r_'},
		{1,'ng','i_'},{1,'ng','e_'},
		{2,'ng','yo'}
	}
	for i=1,#syllables do 
		cluster=syllables[i]
		type=cluster[1]
		x=(i-1)*14
		if type == 1 then
			horizontal(
			x,
			0,cluster[2],cluster[3],cluster[4])
		end
		if type == 2 then
			vertical(x,0,cluster[2],cluster[3],cluster[4])
		end	
	end
end

function vertical(x,y,c1,v2,c2)
	syllable(x,y,c1,nil,v2,nil,c2)
end

function hiatus(x,y,c1,v3,c2)
	syllable(x,y,c1,nil,nil,v3,c2)
end

function syllable(x,y,c1,v1,v2,v3,c2,batchim)
	transparent=12
	if batchim==nil then batchim = 11 end
	consonant={
		hangul.consonants[c1],x,y,transparent
	}
	rightVowel={
		hangul.vowels[v1],x+6,y,transparent
	}
	downVowel={
		hangul.vowels[v2],x,y+5,transparent
	}
	finalConsonant={
		hangul.consonants[c2],x,y+batchim,transparent
	}
	diphthong={hangul.vowels[v3],	x+4,y+5,12}
	spr(table.unpack(consonant))
	--hangul.consonants.jj,100,100,12)	
	spr(table.unpack(rightVowel))	
	spr(table.unpack(downVowel))
	spr(
	table.unpack(finalConsonant)
	)
	spr(
	table.unpack(diphthong)
	)
end
